function TopContainer({ myProfileImg, myName, myFolderName }) {
  return (
    <div className="topContainer">
      <img
        className="topContainer__myProfileImg"
        src={myProfileImg}
        alt="myProfileImg"
      />
      <p className="topContainer__myName">{myName}</p>
      <h2 className="topContainer__myFolderName">{myFolderName}</h2>
    </div>
  );
}

export default TopContainer;
